import React from 'react';
import {
    Typography,
    Grid
} from '@material-ui/core'
import './Home.css'


function Home() {
    return(
      <>
        <Grid container spacing={3} className="main">
            <Grid item xs={12}>
                <Typography variant="h1">
                    Pipocando
                </Typography>
            </Grid>
        </Grid>
      </>  
    );
  }
  
  export default Home;
